import React from "react";

function add(a , b){
    let sum = a+b;
    return sum;
}
function min(a , b){
    let min = a-b;
    return min;
}
function mul(a , b){
    let mul = a*b;
    return mul;
}
function divi(a , b){
    let divi = a/b;
    return divi;
}
export default add;
export {min, mul, divi};
